import{_ as e,c as a,o as r,a as n}from"./app.a391a010.js";const f=JSON.parse('{"title":"whoami","description":"","frontmatter":{},"headers":[{"level":2,"title":"🎓Education","slug":"🎓education","link":"#🎓education","children":[{"level":3,"title":"New York University 🇺🇸","slug":"new-york-university-🇺🇸","link":"#new-york-university-🇺🇸","children":[]},{"level":3,"title":"Nanyang Technological University 🇸🇬","slug":"nanyang-technological-university-🇸🇬","link":"#nanyang-technological-university-🇸🇬","children":[]}]},{"level":2,"title":"💼Corporate Experience","slug":"💼corporate-experience","link":"#💼corporate-experience","children":[{"level":3,"title":"Solutions Engineer @ Squirro","slug":"solutions-engineer-squirro","link":"#solutions-engineer-squirro","children":[]},{"level":3,"title":"Software Engineer (full-stack) @ Synthesis","slug":"software-engineer-full-stack-synthesis","link":"#software-engineer-full-stack-synthesis","children":[]}]},{"level":2,"title":"👨‍💻Internships","slug":"👨‍💻internships","link":"#👨‍💻internships","children":[{"level":3,"title":"Software Engineering Intern – TAIGER","slug":"software-engineering-intern-–-taiger","link":"#software-engineering-intern-–-taiger","children":[]},{"level":3,"title":"Software Developer Intern – Panasonic R&D Center Singapore","slug":"software-developer-intern-–-panasonic-r-d-center-singapore","link":"#software-developer-intern-–-panasonic-r-d-center-singapore","children":[]}]}],"relativePath":"whoami/moi.md"}'),i={name:"whoami/moi.md"},t=n('<h1 id="whoami" tabindex="-1"><code>whoami</code> <a class="header-anchor" href="#whoami" aria-hidden="true">#</a></h1><p>Hey, folks! I&#39;m Raghav, a new grad student in Computer Science @ NYU&#39;s <a href="https://cims.nyu.edu/" target="_blank" rel="noreferrer">Courant Institute of Mathematical Sciences</a>. I most recently worked as a solutions engineer at <a href="https://squirro.com/" target="_blank" rel="noreferrer">Squirro</a>. I&#39;m an <a href="https://www.ntu.edu.sg/" target="_blank" rel="noreferrer">NTU (Nanyang Technological University)</a> graduate where I majored in Computer Engineering. I enjoy developing software using my full-stack development and data science skills.</p><p>In addition to my corporate experience, I have research experience in Time Series Forecasting. Learn more about my research <a href="/research">here</a></p><h2 id="🎓education" tabindex="-1">🎓Education <a class="header-anchor" href="#🎓education" aria-hidden="true">#</a></h2><h3 id="new-york-university-🇺🇸" tabindex="-1"><a href="https://www.nyu.edu/" target="_blank" rel="noreferrer">New York University</a> 🇺🇸 <a class="header-anchor" href="#new-york-university-🇺🇸" aria-hidden="true">#</a></h3><h4 id="m-s-computer-science-september-2023-may-2025" tabindex="-1">M.S. - Computer Science (September 2023 - May 2025) <a class="header-anchor" href="#m-s-computer-science-september-2023-may-2025" aria-hidden="true">#</a></h4><p>I&#39;ll be studying at the <a href="https://cims.nyu.edu/" target="_blank" rel="noreferrer">Courant Institute of Mathematical Sciences</a></p><h3 id="nanyang-technological-university-🇸🇬" tabindex="-1"><a href="https://www.ntu.edu.sg/" target="_blank" rel="noreferrer">Nanyang Technological University</a> 🇸🇬 <a class="header-anchor" href="#nanyang-technological-university-🇸🇬" aria-hidden="true">#</a></h3><h4 id="b-eng-computer-engineering-aug-2018-dec-2021" tabindex="-1">B. Eng. - Computer Engineering (Aug 2018 - Dec 2021) <a class="header-anchor" href="#b-eng-computer-engineering-aug-2018-dec-2021" aria-hidden="true">#</a></h4><ul><li>Accelerated Bachelor&#39;s Program</li><li>Elective focus in Artificial Intelligence, Data Science</li><li>NTU President Research Scholar</li><li>Co-curricular highlights - President @ NTU Entrepreneurship Society, Vice Chair @ Hackers for Charity (NTU Open Source Society)</li></ul><h2 id="💼corporate-experience" tabindex="-1">💼Corporate Experience <a class="header-anchor" href="#💼corporate-experience" aria-hidden="true">#</a></h2><h3 id="solutions-engineer-squirro" tabindex="-1">Solutions Engineer @ <a href="https://squirro.com" target="_blank" rel="noreferrer">Squirro</a> <a class="header-anchor" href="#solutions-engineer-squirro" aria-hidden="true">#</a></h3><h4 id="september-2022-june-2023" tabindex="-1">September 2022 - June 2023 <a class="header-anchor" href="#september-2022-june-2023" aria-hidden="true">#</a></h4><p>At Squirro, I worked as a solutions engineer to craft bespoke solutions for clients who want to use our insights engine.</p><p>Here, I was involved in developing solutions for Squirro&#39;s flagship client&#39;s digital transformation initiative, one of the biggest banks in Southeast Asia - OCBC Bank. Here, I focus on the backend aspects of developing features and tools to deliver to clients, as per their requirements.</p><p>Key outcomes -</p><ul><li>Developed the activity tracking feature for keeping an audit trail of user actions regarding who uploaded what documents in, and what metadata was updated and when.</li><li>Created dashboards for admins to visualise and track this audit data.</li><li>Collaborated with customers on a strategic and operational level throughout the stages of solution design, implementation, and support.</li><li>Handled on-premise deployment and DevOps tasks to deploy latest features, and automated these actions using bash scripts</li></ul><p>Skills - Python, Redis, Bash, ReactJS</p><h3 id="software-engineer-full-stack-synthesis" tabindex="-1">Software Engineer (full-stack) @ <a href="https://home.synthesis.partners" target="_blank" rel="noreferrer">Synthesis</a> <a class="header-anchor" href="#software-engineer-full-stack-synthesis" aria-hidden="true">#</a></h3><h4 id="january-2022-september-2022" tabindex="-1">January 2022 - September 2022 <a class="header-anchor" href="#january-2022-september-2022" aria-hidden="true">#</a></h4><p>At Synthesis, I worked as a full stack software engineer. I worked on their social media analysis platform on frontend, backend as well as data engineering aspects.</p><p>Most notably, I developed an algorithm for analysing and ranking social media posts across multiple platforms, using metrics provided in the platforms&#39; APIs. This algorithm is robust across countries and is being used to rank most relevant and interacted posts, and reduce time taken to analyse and gather insights from key social media platforms.</p><p>Other key outcomes -</p><ul><li>Developed new frontend features including the login and registration flow with SSO on Trends Product</li><li>Maintained data pipeline for open data extraction for 2 clients using Python and ElasticSearch for scraping and indexing open data from social media platforms</li></ul><p>Skills - Python, TypeScript, React TypeScript, Golang</p><h2 id="👨‍💻internships" tabindex="-1">👨‍💻Internships <a class="header-anchor" href="#👨‍💻internships" aria-hidden="true">#</a></h2><h3 id="software-engineering-intern-–-taiger" tabindex="-1">Software Engineering Intern – <a href="https://taiger.com" target="_blank" rel="noreferrer">TAIGER</a> <a class="header-anchor" href="#software-engineering-intern-–-taiger" aria-hidden="true">#</a></h3><h4 id="may-2021-august-2021" tabindex="-1">May 2021 - August 2021 <a class="header-anchor" href="#may-2021-august-2021" aria-hidden="true">#</a></h4><p>Here, I worked as a frontend engineer, where I developed the filter configuration feature for their search engine product.</p><p>Other key outcomes -</p><ul><li>Improved version control workflow by introducing unified PR templates</li><li>Developed REST APIs using Flask for testing backend functionality with Frontend prior to deployment by backend team</li></ul><h3 id="software-developer-intern-–-panasonic-r-d-center-singapore" tabindex="-1">Software Developer Intern – <a href="https://research.sg.panasonic.com/?utm_source=rating.sg&amp;utm_medium=referral&amp;utm_campaign=company" target="_blank" rel="noreferrer">Panasonic R&amp;D Center Singapore</a> <a class="header-anchor" href="#software-developer-intern-–-panasonic-r-d-center-singapore" aria-hidden="true">#</a></h3><h4 id="june-2020-december-2020" tabindex="-1">June 2020 - December 2020 <a class="header-anchor" href="#june-2020-december-2020" aria-hidden="true">#</a></h4><ul><li>Developed an android app using Java and a web app using ReactJS from scratch for facial recognition with CRUD(Create, Read, Update, Delete) operations and integrated deep learning models for facial recognition in android apps</li><li>Reduced loading time by 30% and improved accuracy by 10% for facial recognition capabilities</li><li>Created python scripts for capturing, processing and multiple user identification by deep learning models in lesser time and higher frame rate using parallel processing</li><li>Developed scripts using Python for processing infrared images captured from FLIR-developed cameras</li></ul>',34),o=[t];function s(l,d,c,h,u,p){return r(),a("div",null,o)}const m=e(i,[["render",s]]);export{f as __pageData,m as default};
